import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Periods from './components/Periods/Periods'
import LeaguesContainer from './components/Leagues/LeaguesContainer';
import Teams from './components/Teams/Teams';
import TeamSchedule from './components/Teams/TeamSchedule/TeamSchedule';
import LeagueSchedule from './components/Leagues/LeagueSchedule/LeagueSchedule';
import state from './state';


import leaguesData from './data/league';
import leagueTeamsData from './data/TeamssOfLeague149';
import leagueScheduleData from './data/EventsOfLeague177';
import teamScheduleData from './data/EventsOfTeam2618';

import { BrowserRouter, Route } from 'react-router-dom';

import { ReactComponent as LogoLeagues } from './img/league.png';
import { ReactComponent as LogoTeams } from './img/teams.png';
import { ReactComponent as LogoSchedule } from './img/schedule.png';

const SECTIONS = [
    { title: 'Список лиг', component: LeaguesContainer, href: '/leagues', Icon: LogoLeagues },
    { title: 'Расписание лиги' , component: LeagueSchedule, href: '/leagueSchedule', Icon:LogoSchedule  },
    { title: 'Команды', component: Teams, href: '/teams', Icon: LogoTeams },
    { title: 'Расписание команды', component: TeamSchedule, href: '/teamSchedule', Icon: LogoSchedule },
  ];



const App = (props ) => { 
console.log(props.state);
    return(
      <BrowserRouter>    
        <div className="app-wrapper">
          <Header/> 
          <Navbar period={props.state.period} sections={SECTIONS}/> 
          <Periods period={props.state.period} setPeriod={props.setPeriod}/>
          <div className="app-wrapper-content">
              <Route path='/leagues' render={ () => <LeaguesContainer Data={leaguesData} period={props.state.period}/> }/>
              <Route path='/leagueSchedule/:leag_id/per:id' render={ () => <LeagueSchedule Data={leagueScheduleData}/>}/>
              <Route path='/teams/:team_id/per:id' render={ () => <Teams Data={leagueTeamsData}/>}/>
              <Route path='/teamSchedule/:team_id/per:id' render={ () => <TeamSchedule Data={teamScheduleData}/>}/>
          </div>
        </div>
      </BrowserRouter>  
    );//return  

}//class

export default App;
